import React from 'react';
import { 
    IonContent, 
    IonHeader, 
    IonPage, 
    IonTitle, 
    IonToolbar 
} from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab3.css';
import SettingBtn from '../components/variables/SettingBtn';
import SettingsTopBar from '../components/variables/SettingsTopBar';

const Tab3: React.FC = () => {
  return (
    <IonPage>
      <SettingsTopBar />
      <IonContent fullscreen>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Contact</IonTitle>
          </IonToolbar>
        </IonHeader>
        <ExploreContainer name="Contact Page" />
      </IonContent>
    </IonPage>
  );
};

export default Tab3;
